import { lazy } from 'react'

// Pages
const Dashboard = lazy(() => import('../pages/Dashboard'))
const Flood = lazy(() => import('../pages/Flood'))
const AQI = lazy(() => import('../pages/AQI'))
const Waste = lazy(() => import('../pages/Waste'))
const Weather = lazy(() => import('../pages/Blank')) // temp page
const Reports = lazy(() => import('../pages/Reports'))
const Admin = lazy(() => import('../pages/CreateAccount')) // reuse for admin
const Page404 = lazy(() => import('../pages/404'))

/**
 * Internal routes
 */

const routes = [
  {
    path: '/dashboard',
    component: Dashboard,
  },
  {
    path: '/flood',
    component: Flood,
  },
  {
    path: '/aqi',
    component: AQI,
  },
  {
    path: '/waste',
    component: Waste,
  },
  {
    path: '/weather',
    component: Weather,
  },
  {
    path: '/reports',
    component: Reports,
  },
  {
    path: '/admin',
    component: Admin,
  },
  {
    path: '/404',
    component: Page404,
  },
]

export default routes
